        "text": "Six comedians from around the world have joined forces to bring their fresh imported jokes for a unique comedy night at Cafe Munchies, On Nut!\n\nFasten your seatbelts as you prepare yourselves for:\n\nMax Maiboroda(Ukraine)\nSimon Sherbakov(Russia)\nLiam Wilkinson(Scotland)\nDaniel Holmes(US)\nAlex Latour(US)\nand your host Deniz B. Turan(Turkey).\n\nCome be a (very small) part of history as you witness some of the finest joke machines in the continent to do what they do best!\n\nLIMITED SEATS\nDOORS 20:00\nGet tickets from the link in first comment:",
